def get_simple_model():
    from keras.layers import Convolution2D, Dense, Dropout, Flatten, Input, MaxPooling2D
    from keras.models import Model

    img_input = Input(shape=(26, 26, 3))
    x = Convolution2D(4, 3, 3, activation='relu', border_mode='same')(img_input)
    x = MaxPooling2D((2, 2))(x)
    x = Convolution2D(8, 3, 3, activation='relu', border_mode='same')(x)
    x = MaxPooling2D((2, 2))(x)
    x = Convolution2D(16, 3, 3, activation='relu', border_mode='same')(x)
    x = MaxPooling2D((2, 2))(x)
    x = Flatten()(x)
    x = Dense(100, activation='relu', name='p1')(x)
    x = Dropout(0.5)(x)
    x = Dense(5270, activation='softmax', name='predictions')(x)
    model = Model(input=img_input, output=x)
    print(model.summary())
    return model


def batch_generator_train(images, labels):
    from keras.utils import np_utils
    random.seed(time.time())

    count = 0
    batch_size = 1000
    train_indexes = list(range(len(images)))
    random.shuffle(train_indexes)

    while True:
        batch_indexes = train_indexes[count:count + batch_size]
        image_list = images[batch_indexes].astype(np.float32).copy()
        batch_labels = labels[batch_indexes].copy()
        image_list /= 255.0
        labels_list = np_utils.to_categorical(batch_labels, 5270)

        count += batch_size
        if count + batch_size > len(train_indexes):
            random.shuffle(train_indexes)
            count = 0

        yield image_list, labels_list


def squeeze_weights(model):
    weights = dict()
    bias = dict()
    weights[0], bias[0] = model.layers[1].get_weights()
    weights[1], bias[1] = model.layers[3].get_weights()
    weights[2], bias[2] = model.layers[5].get_weights()
    weights[3], bias[3] = model.layers[8].get_weights()
    weights[4], bias[4] = model.layers[10].get_weights()
    for i in range(0, 5):
        print(weights[i].shape)
        weights[i] = np.round(weights[i], 2)
        bias[i] = np.round(bias[i], 2)

    save_in_file((weights, bias), OUTPUT_PATH + 'cache.pklz')
    f = open(OUTPUT_PATH + 'cache.pklz', 'rb')
    line = f.read()
    line = base64.b64encode(line)
    print(line.decode())


def restore_weights(model):
    line = ''
    line = base64.b64decode(line)
    decompressed_data = zlib.decompress(line, 16 + zlib.MAX_WBITS)
    weights, bias = pickle.loads(decompressed_data)
    model.layers[1].set_weights((weights[0], bias[0]))
    model.layers[3].set_weights((weights[1], bias[1]))
    model.layers[5].set_weights((weights[2], bias[2]))
    model.layers[8].set_weights((weights[3], bias[3]))
    model.layers[10].set_weights((weights[4], bias[4]))


def get_label_encoder():
    s = pd.read_csv("../input/category_names.csv")
    le = LabelEncoder()
    cats = list(s['category_id'].values)
    le.fit(cats)
    return le


def train_net():
    import keras.backend as K
    from keras.callbacks import EarlyStopping, ModelCheckpoint, CSVLogger
    from keras.optimizers import Adam
    global THREADS
    K.set_image_dim_ordering('tf')

    if 0:
        in_file = OUTPUT_PATH + "results_train_.pklz"
        full_hashes, full_ids, full_categories = load_from_file(in_file)
    else:
        full_hashes = []
        full_ids = []
        full_categories = []
        for i in range(THREADS):
            pklz_file = OUTPUT_PATH + "results_train_{}.pklz".format(i)
            h, i, c = load_from_file(pklz_file)
            full_hashes += h
            full_ids += i
            full_categories += c
        full_hashes = np.array(full_hashes)
        full_ids = np.array(full_ids)
        full_categories = np.array(full_categories)

    le = get_label_encoder()
    full_categories_transformed = le.transform(full_categories)
    print('Categories:', len(le.classes_))
    model = get_simple_model()
    optim = Adam(lr=0.001)
    model.compile(optimizer=optim, loss='categorical_crossentropy', metrics=['accuracy'])

    split_point = 8*len(full_hashes) // 10
    if 1:
        model.load_weights(OUTPUT_PATH + 'simple_weights.hdf5')
        callbacks = [
            EarlyStopping(monitor='val_loss', patience=3, verbose=0),
            ModelCheckpoint(OUTPUT_PATH + 'simple_weights_temp.hdf5', monitor='val_loss', save_best_only=True, verbose=0),
        ]
        history = model.fit_generator(
            generator=batch_generator_train(full_hashes[:split_point], full_categories_transformed[:split_point]),
            nb_epoch=3,
            samples_per_epoch=len(full_hashes[:split_point]),
            validation_data=batch_generator_train(full_hashes[split_point:], full_categories_transformed[split_point:]),
            nb_val_samples=len(full_hashes[split_point:]),
            verbose=1,
            max_q_size=5,
            callbacks=callbacks)
        model.save_weights(OUTPUT_PATH + 'simple_weights.hdf5')
    else:
        model.load_weights(OUTPUT_PATH + 'simple_weights.hdf5')

    squeeze_weights(model)


def process_test():
    import keras.backend as K
    global THREADS
    K.set_image_dim_ordering('tf')

    le = get_label_encoder()

    print('Restoring model...')
    model = get_simple_model()
    restore_weights(model)

    result = []
    full_ids = []
    for i in range(THREADS):
        pklz_file = OUTPUT_PATH + "results_test_{}.pklz".format(i)
        if not os.path.isfile(pklz_file):
            continue
        h, i = load_from_file(pklz_file)
        h = np.array(h).astype(np.float32) / 255.0
        dt = model.predict(h, verbose=1, batch_size=4096)
        ind = np.argmax(dt, axis=1)
        ind = le.inverse_transform(ind)
        result.append(ind)
        full_ids += i
    result = np.concatenate(result)
    full_ids = np.array(full_ids)
    print('Length of data: {}'.format(len(result)))
    result_dict = dict(zip(full_ids, result))
    print('Length of resulted dict: {}'.format(len(result_dict)))

    solved = pd.DataFrame.from_dict(result_dict, orient='index').rename(columns={0: 'category_id'})
    solved['_id'] = solved.index
    subm = pd.read_csv("../input/sample_submission.csv")
    subm = pd.merge(subm[['_id']], solved, how='left', on=['_id'], left_index=True)
    subm.fillna(value=1, inplace=True)
    subm['category_id'] = subm['category_id'].astype(np.uint64)
    print(subm.dtypes)
    subm.loc[subm['category_id'] == 1, 'category_id'] = 1000010653
    subm.to_csv(OUTPUT_PATH + 'subm.csv', index=False)


